import React from 'react'
import { Link } from 'react-router-dom'

const InterestBoard = () => {
  return (
    <div className='dark:bg-theme-dark-background text-theme-light-text dark:text-theme-dark-text
    h-screen w-full flex flex-col justify-center items-center'> 
        <h1 className='text-9xl'> Interest Board Page</h1>
        <Link to="/">Home</Link>
    </div>
  );
}

export default InterestBoard
